import React from "react";
import { Button } from "react-bootstrap";

function Login() {
  return (
    <div className="text-center mt-5">
      <h1>Login</h1>
      <div>
        <input type="text" placeholder="Email"></input>
        <input type="password" placeholder="Password"></input>
        <Button>Login</Button>
      </div>
    </div>
  );
}

export default Login;
